(2, 1, '2019-11-11 10:25:01', '2019-11-11 10:25:01', '', 'Home Page', '', 'publish', 'closed', 'open', '', 'home-page', '', '', '2020-03-02 06:09:53', '2020-03-02 06:09:53', '', 0, 'https://goalore.com/?page_id=2', 0, 'page', '', 0),
(3, 1, '2019-11-11 10:25:01', '2019-11-11 10:25:01', '<!-- wp:paragraph -->\n<p>Last Updated: September 02, 2018</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><br>Our Privacy Policy governs the privacy terms of our website, located at https://www.Goalore.com and the Goalore mobile application (together, or individually, the "Service") operated by Goalore Inc ("us", "we", or "our").</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Your Privacy<br>Our Service follows all legal requirements to protect your privacy. Our Privacy Policy is a legal statement that explains how we may collect information from you, how we may share your information, and how you can limit our sharing of your information. You will see terms in our Privacy Policy that are capitalized. These terms have meanings as described in the Definitions section below.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Definitions<br>Personal Data:&nbsp;Personal Data means data about a living individual who can be identified from those data (or from those and other information either in our possession or likely to come into our possession).</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Usage Data:&nbsp;Usage Data is data collected automatically either generated by the use of the Service or from the Service infrastructure itself (for example, the duration of a page visit).</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Cookies:&nbsp;Cookies are small pieces of data stored on a User\'s device.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Data Controller:&nbsp;Data Controller means a natural or legal person who (either alone or jointly or in common with other persons) determines the purposes for which and the manner in which any personal data are, or are to be, processed. For the purpose of this Privacy Policy, we are a Data Controller of your data.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Data Processors (or Service Providers):&nbsp;Data Processor (or Service Provider) means any natural or legal person who processes the data on behalf of the Data Controller. We may use the services of various Service Providers in order to process your data more effectively.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Data Subject:&nbsp;Data Subject is any living individual who is the subject of Personal Data.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>User:&nbsp;The User is the individual using our Service. The User corresponds to the Data Subject, who is the subject of Personal Data.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Information Collection And Use<br>We collect several different types of information for various purposes to provide and improve our Service to you.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Types of Data Collected</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Personal Data</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>While using our Service, we may ask you to provide us with certain personally identifiable information that can be used to contact or identify you ("Personal Data"). Personally identifiable information may include, but is not limited to: Email address, Name, Address, State, Province, ZIP/Postal code, City, Cookies and Usage Data.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We may use your Personal Data to contact you with newsletters, marketing or promotional materials and other information that may be of interest to you. You may opt out of receiving any, or all, of these communications from us by following the unsubscribe link or instructions provided in any email we send.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Usage Data<br>We may also collect information how the Service is accessed and used ("Usage Data"). This Usage Data may include information such as your computer\'s Internet Protocol address (e.g. IP address), browser type, browser version, the pages of our Service that you visit, the time and date of your visit, the time spent on those pages, unique device identifiers and other diagnostic data.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Tracking &amp; Cookies Data<br>We use cookies and similar tracking technologies to track the activity on our Service and hold certain information.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Cookies are files with small amount of data which may include an anonymous unique identifier. Cookies are sent to your browser from a website and stored on your device. Tracking technologies also used are beacons, tags, and scripts to collect and track information and to improve and analyze our Service.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>You can instruct your browser to refuse all cookies or to indicate when a cookie is being sent. However, if you do not accept cookies, you may not be able to use some portions of our Service.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Examples of Cookies we use:&nbsp;session cookies&nbsp;(we use these cookies to operate our Service) and&nbsp;preference cookies&nbsp;(we use these cookies to remember your preferences and various settings).</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Use of Data<br>We use the collected data for various purposes:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>To provide and maintain our Service</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>To notify you about changes to our Service</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>To allow you to participate in interactive features of our Service when you choose to do so</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>To provide customer support</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>To gather analysis or valuable information so that we can improve our Service</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>To monitor the usage of our Service</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>To detect, prevent and address technical issues</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>To provide you with news, special offers and general information about other goods, services and events which we offer that are similar to those that you have already registered for or enquired about unless you have opted not to receive such information</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Retention of Data</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><br>We will retain your Personal Data only for as long as is necessary for the purposes set out in this Privacy Policy. We will retain and use your Personal Data to the extent necessary to comply with our legal obligations (for example, if we are required to retain your data to comply with applicable laws), resolve disputes, and enforce our legal agreements and policies.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We will also retain Usage Data for internal analysis purposes. Usage Data is generally retained for a shorter period of time, except when this data is used to strengthen the security or to improve the functionality of our Service, or we are legally obligated to retain this data for longer time periods.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Transfer Of Data<br>Your information, including Personal Data, may be transferred to — and maintained on — computers located outside of your state, province, country or other governmental jurisdiction where the data protection laws may differ than those from your jurisdiction.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We will take all steps reasonably necessary to ensure that your data is treated securely and in accordance with this Privacy Policy and no transfer of your Personal Data will take place to an organization or a country unless there are adequate controls in place including the security of your data and other personal information.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Your consent to this Privacy Policy followed by your submission of such information represents your agreement to that transfer.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Disclosure Of Data<br>Business Transaction.&nbsp;If we are involved in a merger, acquisition or asset sale, your Personal Data may be transferred. We will provide notice before your Personal Data is transferred and becomes subject to a different Privacy Policy.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Disclosure for Law Enforcement.&nbsp;Under certain circumstances, we may be required to disclose your Personal Data if required to do so by law or in response to valid requests by public authorities (e.g. a court or a government agency).</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Security Of Data<br>The security of your data is important to us, but remember that no method of transmission over the Internet, or method of electronic storage is 100% secure. While we strive to use commercially acceptable means to protect your Personal Data, we cannot guarantee its absolute security.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Service Providers<br>We may employ third party companies and individuals to facilitate our Service ("Service Providers"), to provide the Service on our behalf, to perform Service-related services or to assist us in analyzing how our Service is used.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>These third parties have access to your Personal Data only to perform these tasks on our behalf and are obligated not to disclose or use it for any other purpose.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Links To Other Sites<br>Our Service may contain links to other sites that are not operated by us. If you click on a third-party link, you will be directed to that third party\'s site. We strongly advise you to review the Privacy Policy of every site you visit.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We have no control over and assume no responsibility for the content, privacy policies or practices of any third-party sites or services.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Children\'s Privacy<br>Our Service does not address anyone under the age of 18 ("Children").</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We do not knowingly collect personally identifiable information from anyone under the age of 18. If you are a parent or guardian and you are aware that your Children has provided us with Personal Data, please contact us. If we become aware that we have collected Personal Data from children without verification of parental consent, we take steps to remove that information from our servers.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Changes To This Privacy Policy<br>We may update our Privacy Policy from time to time. We will notify you of any changes by posting the new Privacy Policy on this page.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We will let you know via email and/or a prominent notice on our Service, prior to the change becoming effective and update the "effective date" at the top of this Privacy Policy.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>You are advised to review this Privacy Policy periodically for any changes. Changes to this Privacy Policy are effective when they are posted on this page.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Contact Us</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you have any questions about this Privacy Policy, please contact us by using the contact information&nbsp;we provided on our Contact page.<br></p>\n<!-- /wp:paragraph -->', 'Privacy Policy', '', 'publish', 'closed', 'open', '', 'privacy-policy', '', '', '2020-01-17 07:20:30', '2020-01-17 07:20:30', '', 0, 'https://goalore.com/?page_id=3', 0, 'page', '', 0),
