ice.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>You are responsible for maintaining the confidentiality of your account and password, including but not limited to the restriction of access to your computer and/or account. You agree to accept responsibility for any and all activities or actions that occur under your account and/or password, whether your password is with our Service or a third-party service. You must notify us immediately upon becoming aware of any breach of security or unauthorized use of your account.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>You may not use as a username the name of another person or entity or that is not lawfully available for use, a name or trademark that is subject to any rights of another person or entity other than you, without appropriate authorization. You may not use as a username any name that is offensive, vulgar or obscene.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>Intellectual Property</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>The Service and its original content (excluding Content provided by users), features and functionality are and will remain the exclusive property of Goalore Inc and its licensors. The Service is protected by copyright, trademark, and other laws of both the United States and foreign countries. Our trademarks and trade dress may not be used in connection with any product or service without the prior written consent of Goalore Inc.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>Links To Other Web Sites</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Our Service may contain links to third party web sites or services that are not owned or controlled by Goalore Inc</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Goalore Inc has no control over, and assumes no responsibility for the content, privacy policies, or practices of any third party web sites or services. We do not warrant the offerings of any of these entities/ind