(49, 1, '2019-11-12 10:46:08', '2019-11-12 10:46:08', '<!-- wp:paragraph -->\n<p>Being with friends and family is a lot of fun. We have a lot of things in common, spend a significant part of our daily life, sharing aspirations and challenges with them. Friends and family roll up their sleeves to support us in our time of need and we would do the same for them. We cheer up remembering many fond memories of friendship and create new ones every day. Close friends also don’t hesitate to offer honest and transparent feedback/wisdom to help us – as they are uniquely positioned to do so without offending us.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Whether we acknowledge it or not, friends and family are constantly working with us on many of our goals. This could be planning for a get-together, the next family vacation, changing careers, losing weight, buying a house, or supporting a charity. Based on the goals, this collaboration could be short term with fewer friends/family or longer-term with many. If the goal is a big one, we may want to break it into smaller goals and with our friends/family owning some of the smaller goals. Together, one small goal completed by another, the larger goal is achieved. Working with other close friends/family make the journey pleasurable, providing a sense of purpose, achievement, satisfaction, and further strengthening our bond.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Within Goalore, the alliance feature enables this collaboration between two or more members to work together to achieve a large goal. All Goalore members can create alliances. Alliances can be public alliances or private alliances.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Public Alliances</strong>: These alliances are open to anyone to view and join the alliance.&nbsp;<em>Examples of public alliances:</em>&nbsp;<em>Fundraise for a new school program, Advocate for government policy (climate, safety, freedom, etc.)</em></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Private Alliances:&nbsp;</strong>These alliances are only visible to the alliance members. Members can join the alliance only with an invitation.&nbsp;<em>Examples of private alliances:</em>&nbsp;<em>Lose weight</em>,&nbsp;<em>start a new business, organizing a family reunion, planning a family event, etc.</em></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The following features help to manage the alliance.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Alliance Members</strong>: Members can be Admins or non-admin members. Admins can invite other Goalore members who are connected to them to join the alliance. For public alliances, anyone can join the alliance without invitation. Typically, members who are in a similar goal journey or members interested in the community are good candidates for joining the alliance. They can be regular members within the alliance or admin members of the alliance.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Alliance Goals:</strong>&nbsp;Any member of the alliance can link a goal that is relevant to the alliance objectives. These could be public goals or private goals. Admins can remove a linked goal in addition to linking a goal. Everyone within the alliance can view and follow the alliance goals. With this feature, we can break a large alliance goal/objective into smaller goals that each alliance member can own and achieve.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Alliance Actions:&nbsp;</strong>With this feature, we could track specific actions to manage the alliance. This could be small tasks such as getting an opinion on a topic, asking the admin to invite another friend or asking if someone can start an alliance goal to address a gap.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Join Goalore and start using the alliance feature to achieve your goals by collaborating with other like-minded Goalore members.</p>\n<!-- /wp:paragraph -->', 'Alliance', '', 'publish', 'open', 'open', '', 'alliance', '', '', '2020-01-29 01:01:58', '2020-01-29 01:01:58', '', 0, 'https://goalore.com/?p=49', 0, 'post', '', 0),
