(118, 1, '2019-11-19 09:07:49', '2019-11-19 09:07:49', 'Milestones are important events that occur in the journey towards a goal. A goal could have many milestones along the way.  Milestones help to demonstrate progress. Milestones can be big or small events, but they should be relevant to the goal.', 'What is a milestone?', '', 'publish', 'closed', 'closed', '', 'example-question-2', '', '', '2020-01-31 06:24:41', '2020-01-31 06:24:41', '', 0, 'https://goalore.com/?post_type=faqs&#038;p=118', 24, 'faqs', '', 0),
