(120, 1, '2019-11-19 09:08:23', '2019-11-19 09:08:23', 'POV is provided to the goal owner by a goal follower. POV could be encouragement, words of wisdom, solutions to a challenge or milestone or goal.  As the name suggest, this is a point of view from the goal followers’s perspective. It is up to the goal owner to decide how to use a POV at their sole discretion. We request that all points of view are relevant to the goal and constructive in nature.', 'What is a point of view (POV)?', '', 'publish', 'closed', 'closed', '', 'example-question-1-2', '', '', '2020-01-25 21:46:51', '2020-01-25 21:46:51', '', 0, 'https://goalore.com/?post_type=faqs&#038;p=120', 27, 'faqs', '', 0),
(121, 1, '2019-11-19 09:08:38', '2019-11-19 09:08:38', 'A goal is a positive result that you like to achieve. The goal could be for you, your family and friends, or for the community.\r\n\r\nExamples:  Lose weight.  Learn to speak Spanish. Change career. Organize an event for the local school fund raiser.', 'What is a goal?', '', 'publish', 'closed', 'closed', '', 'example-question-1-3', '', '', '2020-01-25 21:38:27', '2020-01-25 21:38:27', '', 0, 'https://goalore.com/?post_type=faqs&#038;p=121', 17, 'faqs', '', 0),
(122, 1, '2019-11-19 09:08:50', '2019-11-19 09:08:50', 'Challenges are hurdles that come up in the journey towards a goal. Challenges can come up unexpectedly (not always) and must be overcome to achieve a goal. They may be immediate in nature that you must address now or something that will occur in the future.', 'What is a challenge?', '', 'publish', 'closed', 'closed', '', 'example-question-2-3', '', '', '2020-01-25 21:41:18', '2020-01-25 21:41:18', '', 0, 'https://goalore.com/?post_type=faqs&#038;p=122', 25, 'faqs', '', 0),
(123, 1, '2019-11-19 10:38:09', '2019-11-19 10:38:09', '', 'Recent Articles', '', 'inherit', 'closed', 'closed', '', '11-revision-v1', '', '', '2019-11-19 10:38:09', '2019-11-19 10:38:09', '', 11, 'https://goalore.com/11-revision-v1/', 0, 'revision', '', 0),
(125, 1, '2019-11-19 11:39:25', '2019-11-19 11:39:25', '<!-- wp:paragraph -->\n<p>If you are like most of humanity, you are probably chasing a set of self, family, friends, or community related goals. Your goal may look similar to a goal that your friend or an acquaintance is trying to achieve, but everyone’s situation is different. Your personality, location, education, family, friends, community, health, finance, gender, age, aspirations, struggles, and life experience make you one of a kind in this world.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The journey for achieving a goal is unique for everyone. What could be an easy goal to achieve for someone might be a difficult goal to achieve for you (and vice versa) as your situation could be a lot different.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Goalore is an open and free community that helps individuals to achieve their goals. Every member can track their unique journey in achieving their goals – the milestones and challenges that come along the way. Other members can follow your goals and provide their point of views during your journey - share their experience in overcoming a challenge or provide insight into a milestone you might have not thought of.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Within Goalore, you could keep your goals private or make them public. There are no restrictions to number of goals that you can create. Your goal could be a big goal that helps a lot of people in the community or a small goal focused on your development. If you happen to find other members who may be working to achieve a goal like yours, you could form an alliance with those members and work together in achieving the goal.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Our hope is that your unique journey in achieving a goal by working hard, achieving milestones, overcoming challenges, and supported by member point of views will inspire someone else to attain a goal that they thought as out of reach for them. Your encouragement, wisdom, and solutions could be a catalyst for someone else.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you are already a Goalore member, we thank you for your membership and support for our community. If you are not a member, we humbly request you to join our community, invite your friends, and join us on many journeys in achieving goals and inspiring others.</p>\n<!-- /wp:paragraph -->', 'What is Goalore?', 'There are no restrictions to number of goals that you can create.', 'inherit', 'closed', 'closed', '', '61-revision-v1', '', '', '2019-11-19 11:39:25', '2019-11-19 11:39:25', '', 61, 'https://goalore.com/61-revision-v1/', 0, 'revision', '', 0) ;
