(472, 20, '2020-01-05 22:17:53', '2020-01-05 22:17:53', 'The goal owner must create a private alliance and link the private goal to the alliance. The goal owner can then invite members from their connections to join the alliance. Everyone in the alliance can view and follow the private goal linked to that alliance.', 'How can I share my private goals with my connections?', '', 'publish', 'closed', 'closed', '', 'how-can-i-share-my-private-goals-with-other-members', '', '', '2020-01-25 22:05:40', '2020-01-25 22:05:40', '', 0, 'https://goalore.com/?post_type=faqs&#038;p=472', 30, 'faqs', '', 0),
(476, 20, '2020-01-18 15:06:48', '2020-01-18 15:06:48', 'We recommend updating goals at least once a week. This could be creating or updating your goal milestones and challenges, rating the points of view, and responding to points of view.', 'When should I update a goal?', '', 'publish', 'closed', 'closed', '', 'when-should-i-update-a-goal', '', '', '2020-01-25 21:48:20', '2020-01-25 21:48:20', '', 0, 'https://goalore.com/?post_type=faqs&#038;p=476', 23, 'faqs', '', 0),
