(536, 1, '2020-01-25 21:38:08', '2020-01-25 21:38:08', 'A goal is a positive result that you like to achieve. The goal could be for you, your family and friends, or for the community.\n\nExamples:  Lose wWeight.  Learn to speak Spanish. Change career. We want to organize an event for the local school fund raiser.', 'What is a goal?', '', 'inherit', 'closed', 'closed', '', '121-autosave-v1', '', '', '2020-01-25 21:38:08', '2020-01-25 21:38:08', '', 121, 'https://goalore.com/121-autosave-v1/', 0, 'revision', '', 0),
(537, 1, '2020-01-25 21:41:08', '2020-01-25 21:41:08', 'Challenges are hurdles that come up in the journey towards a goal. Challenges can come up unexpectedly (not always) and must be overcome to achieve a goal. They may be immediate in nature that you must address now or something that will occur in the future.', 'What is a challenge?', '', 'inherit', 'closed', 'closed', '', '122-autosave-v1', '', '', '2020-01-25 21:41:08', '2020-01-25 21:41:08', '', 122, 'https://goalore.com/122-autosave-v1/', 0, 'revision', '', 0),
(538, 1, '2020-01-25 21:46:19', '2020-01-25 21:46:19', 'POV is provided to the goal owner by a goal follower. POV could be encouragement, words of wisdom, solutions to a challenge or milestone or goal.  As the name suggest, this is a point of view from the goal followers’s perspective. It is up to the goal owner to decide how to use a POV at their sole discretion. We request that all points of view be provided that is relevant to the goal and is constructive in nature.', 'What is a point of view (POV)?', '', 'inherit', 'closed', 'closed', '', '120-autosave-v1', '', '', '2020-01-25 21:46:19', '2020-01-25 21:46:19', '', 120, 'https://goalore.com/120-autosave-v1/', 0, 'revision', '', 0),
(539, 1, '2020-01-25 21:49:46', '2020-01-25 21:49:46', 'Create a private alliance and attach your private goals to the alliance. Invite your connections to join the private alliance with whom you want to share your private goals. You can then attach your private goals to the Alliance and the goals will only be visible to the members of the Alliance.', 'How can I share my private goals with my connections?', '', 'inherit', 'closed', 'closed', '', '472-autosave-v1', '', '', '2020-01-25 21:49:46', '2020-01-25 21:49:46', '', 472, 'https://goalore.com/472-autosave-v1/', 0, 'revision', '', 0),
(540, 1, '2020-01-25 21:53:57', '2020-01-25 21:53:57', 'The goal owner can rate a POV based on how it helped them in their unique goal journey, by clicking on the blub icons.  The goal follower who provided the POV will get good deed points as per the following.\r\n\r\n1 bulb = 2 good deed points\r\n\r\n2 bulbs = 4 good deed points\r\n\r\n3 bulbs = 6 good deed points\r\n\r\n4 bulbs = 8 good deed points\r\n\r\nIf a POV is not relevant to the goal, the goal owner can also block the POV by clicking on the block icon.', 'What is a point of view (POV) rating?', '', 'publish', 'closed', 'closed', '', 'what-is-a-point-of-view-pov-rating', '', '', '2020-01-31 05:49:30', '2020-01-31 05:49:30', '', 0, 'https://goalore.com/?post_type=faqs&#038;p=540', 28, 'faqs', '', 0),
(541, 1, '2020-01-25 21:56:05', '2020-01-25 21:56:05', 'In addition to POV ratings, the goal owner could choose to respond to the POV directly.', 'What is a point of view (POV) response?', '', 'publish', 'closed', 'closed', '', 'what-is-a-point-of-view-pov-response', '', '', '2020-01-25 21:56:05', '2020-01-25 21:56:05', '', 0, 'https://goalore.com/?post_type=faqs&#038;p=541', 29, 'faqs', '', 0),
(542, 1, '2020-01-25 21:57:38', '2020-01-25 21:57:38', 'A goal can be a created as a public goal. A public goal is visible to all members within Goalore. They are included in the goal count displayed within the goal owner\'s profile and displayed in the profile page. Public goals are also included in member searches.\r\n\r\nPublic goals can be linked to an alliance by the goal owner.\r\n\r\nOnce a goal is public, it cannot be made private again.', 'What is a public goal?', '', 'publish', 'closed', 'closed', '', 'what-is-a-public-goal', '', '', '2020-01-25 22:00:26', '2020-01-25 22:00:26', '', 0, 'https://goalore.com/?post_type=faqs&#038;p=542', 19, 'faqs', '', 0),
(543, 1, '2020-01-25 21:59:11', '2020-01-25 21:59:11', 'A goal can be created as a private goal.  When a private goal is not linked to an alliance, it is only visible to the goal owner.  They are included in the goal count displayed within the goal owner\'s profile, but are not displayed in the profile page. Private goals are excluded from member searches.\r\n\r\nA private goal can be linked to an alliance by the goal owner. Check alliance FAQ on who can view private goals linked to alliances.\r\n\r\nA private goal can be made public by the goal owner.', 'What is a private goal?', '', 'publish', 'closed', 'closed', '', 'what-is-a-private-goal', '', '', '2020-01-25 22:01:14', '2020-01-25 22:01:14', '', 0, 'https://goalore.com/?post_type=faqs&#038;p=543', 20, 'faqs', '', 0),
(544, 1, '2020-01-25 22:03:32', '2020-01-25 22:03:32', 'Members can follow a goal to support a friend, family member, community, alliance, or to follow the goal journey. Anyone viewing a goal can click on the follow button to start following the goal. Such goals are called followed goals. Goal followers can provide points of view to help the goal owner.\r\n\r\nThe goal owner gets good deed points based on the number of followers at the time of completing the goal.', 'What is a followed goal?', '', 'publish', 'closed', 'closed', '', 'what-is-a-followed-goal', '', '', '2020-01-25 22:03:32', '2020-01-25 22:03:32', '', 0, 'https://goalore.com/?post_type=faqs&#038;p=544', 21, 'faqs', '', 0),
(545, 1, '2020-01-25 22:04:23', '2020-01-25 22:04:23', 'The goal owner can archive a goal at any time and for any reason. Once archived, the goal owner cannot make any further changes to the goal.  An archived goal is no longer available within the member’s goal dashboard or profile page. If the archived goal is a public goal, it is still included in search results.', 'What is an archived goal?', '', 'publish', 'closed', 'closed', '', 'what-is-an-archived-goal', '', '', '2020-01-25 22:04:23', '2020-01-25 22:04:23', '', 0, 'https://goalore.com/?post_type=faqs&#038;p=545', 22, 'faqs', '', 0) ;
INSERT INTO `wp_posts` ( `ID`, `post_author`, `post_date`, `post_date_gmt`, `post_content`, `post_title`, `post_excerpt`, `post_status`, `comment_status`, `ping_status`, `post_password`, `post_name`, `to_ping`, `pinged`, `post_modified`, `post_modified_gmt`, `post_content_filtered`, `post_parent`, `guid`, `menu_order`, `post_type`, `post_mime_type`, `comment_count`) VALUES
(547, 1, '2020-01-25 22:06:37', '2020-01-25 22:06:37', '<ul>\r\n 	<li>An alliance admin can change the alliance title, objectives, alliance status, and privacy status.</li>\r\n 	<li>They can invite their connections to join the alliance.</li>\r\n 	<li>They can make an existing alliance member an admin for the alliance.</li>\r\n 	<li>They can remove admin privileges from an existing admin to the alliance.</li>\r\n 	<li>They can link their public and private goals to the alliance.</li>\r\n 	<li>They can unlink goals from the alliance.</li>\r\n 	<li>They can post and respond to actions.</li>\r\n</ul>', 'What are the privileges for an alliance admin?', '', 'publish', 'closed', 'closed', '', 'what-are-the-privileges-for-an-alliance-admin', '', '', '2020-01-25 22:06:37', '2020-01-25 22:06:37', '', 0, 'https://goalore.com/?post_type=faqs&#038;p=547', 13, 'faqs', '', 0),
(548, 1, '2020-01-25 22:08:07', '2020-01-25 22:08:07', 'Yes. Any alliance member can link their private or public goals to the alliance.\r\n\r\nNote : If you link your private goal to a public alliance, the <strong>private goal will be visible to everyone</strong> as public alliances are open for everyone to view and join.', 'Can I link my private goal to a public alliance?', '', 'publish', 'closed', 'closed', '', 'can-i-link-my-private-goal-to-a-public-alliance', '', '', '2020-01-25 22:08:07', '2020-01-25 22:08:07', '', 0, 'https://goalore.com/?post_type=faqs&#038;p=548', 11, 'faqs', '', 0),
(549, 1, '2020-01-25 22:09:26', '2020-01-25 22:09:26', 'Alliances enable Goalore members to work with other members to achieve common goals.', 'What is an alliance?', '', 'publish', 'closed', 'closed', '', 'what-is-an-alliance', '', '', '2020-01-25 22:09:26', '2020-01-25 22:09:26', '', 0, 'https://goalore.com/?post_type=faqs&#038;p=549', 6, 'faqs', '', 0),
(550, 1, '2020-01-25 22:11:02', '2020-01-25 22:11:02', 'Any alliance with a privacy status of private is an private alliance.  Private alliances are only visible to the members of the alliance. Members must be invited by an alliance admin to join the private alliance.', 'What is a private alliance?', '', 'publish', 'closed', 'closed', '', 'what-is-a-private-alliance', '', '', '2020-01-25 22:11:02', '2020-01-25 22:11:02', '', 0, 'https://goalore.com/?post_type=faqs&#038;p=550', 9, 'faqs', '', 0),
(551, 1, '2020-01-25 22:12:31', '2020-01-25 22:12:31', 'Alliances with a privacy status of public are called as public alliances.  Public alliances are visible to all Goalore members. Anyone can join a public alliance to become a member of the alliance.\r\n\r\nAlliances formed to support the larger community goals are good examples for public alliances.', 'What is a public alliance?', '', 'publish', 'closed', 'closed', '', 'what-is-a-public-alliance', '', '', '2020-01-25 22:12:31', '2020-01-25 22:12:31', '', 0, 'https://goalore.com/?post_type=faqs&#038;p=551', 8, 'faqs', '', 0),
(552, 1, '2020-01-25 22:13:01', '2020-01-25 22:13:01', 'There are no limitations to the number of alliances a member can create or join.', 'Are there limitations to number of alliances?', '', 'publish', 'closed', 'closed', '', 'are-there-limitations-to-number-of-alliances', '', '', '2020-01-25 22:13:01', '2020-01-25 22:13:01', '', 0, 'https://goalore.com/?post_type=faqs&#038;p=552', 7, 'faqs', '', 0),
(554, 1, '2020-01-25 22:19:37', '2020-01-25 22:19:37', 'An alliance admin can archive an alliance. This is typically done when the alliance objectives are met and alliance can be closed. Such archived alliances are removed from member’s admin dashboard. The alliance can be viewed using the Archives. Once archived, the member cannot make any further changes to the alliance.\r\n\r\nNote: When a member archives an alliance, it is only archived for that member. Other admins and members will not see any changes to the alliance.', 'What is an archived alliance?', '', 'publish', 'closed', 'closed', '', 'what-is-an-archived-alliance', '', '', '2020-01-25 22:20:33', '2020-01-25 22:20:33', '', 0, 'https://goalore.com/?post_type=faqs&#038;p=554', 16, 'faqs', '', 0),
(556, 1, '2020-01-25 22:21:52', '2020-01-25 22:21:52', 'As part of the alliance, members can create individual goals to support alliance objectives. Alliance members can link their public or private goals to the alliance. All members of the alliance can view, follow these goals.', 'What are alliance goals?', '', 'publish', 'closed', 'closed', '', 'what-are-alliance-goals', '', '', '2020-01-25 22:21:52', '2020-01-25 22:21:52', '', 0, 'https://goalore.com/?post_type=faqs&#038;p=556', 10, 'faqs', '', 0),
(557, 1, '2020-01-25 22:23:37', '2020-01-25 22:23:37', 'Anyone part of an alliance are called alliance members. An alliance admin can make a member admin to an alliance. Alliance admins have additional privileges compared to a member of the alliance. Alliance members, except for the member who created the alliance, can leave an alliance at any time.', 'What are alliance members?', '', 'publish', 'closed', 'closed', '', 'what-are-alliance-members', '', '', '2020-01-25 22:23:37', '2020-01-25 22:23:37', '', 0, 'https://goalore.com/?post_type=faqs&#038;p=557', 12, 'faqs', '', 0),
(558, 1, '2020-01-25 22:26:21', '2020-01-25 22:26:21', '<ul>\r\n 	<li>Link their private and public goals to the alliance</li>\r\n 	<li>View and follow linked goals in the alliance</li>\r\n 	<li>View alliance members</li>\r\n 	<li>Post and respond to actions</li>\r\n 	<li>Leave the alliance</li>\r\n</ul>', 'What are the privileges for an alliance member?', '', 'publish', 'closed', 'closed', '', 'what-are-the-privileges-for-an-alliance-member', '', '', '2020-01-25 22:26:21', '2020-01-25 22:26:21', '', 0, 'https://goalore.com/?post_type=faqs&#038;p=558', 14, 'faqs', '', 0),
(559, 1, '2020-01-25 22:28:43', '2020-01-25 22:28:43', 'Within an alliance, members can use the action log to track and manage actions to help the alliance. Once a member posts an action, other alliance members can then respond to that action.\r\n\r\nExamples : Requesting an admin to add a new member to the alliance, requesting members to own a new goal in support of the alliance, posting questions, or providing general information to other alliance members.', 'What are alliance actions?', '', 'publish', 'closed', 'closed', '', 'what-are-alliance-actions', '', '', '2020-01-25 22:28:43', '2020-01-25 22:28:43', '', 0, 'https://goalore.com/?post_type=faqs&#038;p=559', 15, 'faqs', '', 0),
(560, 1, '2020-01-25 22:31:26', '2020-01-25 22:31:26', 'Yes!  You can invite your friends to join Goalore. As our community grows, it creates more opportunities to each other, inspire others, and form alliances. If you invite a friend and your friend joins Goalore using your invitation, you will get good deed points as appreciation for your support to the community.', 'Can I invite a friend?', '', 'publish', 'closed', 'closed', '', 'can-i-invite-a-friend', '', '', '2020-01-25 22:31:26', '2020-01-25 22:31:26', '', 0, 'https://goalore.com/?post_type=faqs&#038;p=560', 4, 'faqs', '', 0),
(561, 1, '2020-01-25 22:42:55', '2020-01-25 22:42:55', '<ul>\r\n 	<li>Username, good deed points, member since date, number of connections, goals, and alliances, public goals, and public alliances are displayed in the member profile.</li>\r\n 	<li>Members have a choice to publicly display or hide their personal information within the user settings.</li>\r\n</ul>', 'How does user settings work?', '', 'publish', 'closed', 'closed', '', 'how-does-user-settings-work', '', '', '2020-01-25 22:42:55', '2020-01-25 22:42:55', '', 0, 'https://goalore.com/?post_type=faqs&#038;p=561', 3, 'faqs', '', 0),
(562, 1, '2020-01-25 22:44:43', '2020-01-25 22:44:43', 'Member\'s public goals and public alliances are displayed in the member profile page.\r\n\r\nNote: The count of goals at the top of the profile page includes both private and public goals. The count of alliances at the top of the profile page includes both private and public alliances.', 'What goals and alliances are visible in a member profile page?', '', 'publish', 'closed', 'closed', '', 'what-goals-and-alliances-are-visible-in-a-member-profile-page', '', '', '2020-01-25 22:44:43', '2020-01-25 22:44:43', '', 0, 'https://goalore.com/?post_type=faqs&#038;p=562', 5, 'faqs', '', 0),
(563, 1, '2020-01-25 22:45:22', '2020-01-25 22:45:22', 'Good Deed Points are a measure of good deeds performed by the member by inspiring the community through their goals and helping other members with their goals.', 'What are good deed points™?', '', 'publish', 'closed', 'closed', '', 'what-are-good-deed-points', '', '', '2020-01-25 22:45:22', '2020-01-25 22:45:22', '', 0, 'https://goalore.com/?post_type=faqs&#038;p=563', 0, 'faqs', '', 0),
(564, 1, '2020-01-25 22:49:01', '2020-01-25 22:49:01', 'Good Deed Points can be earned in the following ways.\r\n<ul>\r\n 	<li>Good deed points (50) earned by joining Goalore.</li>\r\n 	<li>Good deed points earned by referring friends and family to join Goalore to grow/support the community. Each referral who joins Goalore will earn 10 good deed points.</li>\r\n 	<li>Good deed points earned by the number of followers for completed goals. 1 point is allocated for each follower of the goal, when the goal was completed. This recognition is for inspiring other members within the Goalore community to follow and support your goal through completion.</li>\r\n 	<li>Good deed points earned by points of view (POV) provided for followed goals. The goal owner\'s rating determines the good deed points earned for the POV.\r\n<ul>\r\n 	<li><em>1 bulb= 2 good deed points</em></li>\r\n 	<li><em>2 bulbs = 4 good deed points</em></li>\r\n 	<li><em>3 bulbs = 6 good deed points</em></li>\r\n 	<li><em>4 bulbs = 8 good deed points</em></li>\r\n</ul>\r\n</li>\r\n</ul>', 'What are the ways to get good deed points™?', '', 'publish', 'closed', 'closed', '', 'what-are-the-ways-to-get-good-deed-points', '', '', '2020-01-31 05:52:14', '2020-01-31 05:52:14', '', 0, 'https://goalore.com/?post_type=faqs&#038;p=564', 1, 'faqs', '', 0),
(565, 1, '2020-01-25 22:50:16', '2020-01-25 22:50:16', 'Good deed points are used to create greater visibility to help members with their goals. Specifically,\r\n<ul>\r\n 	<li>Goals owned by member with the highest good deed points are displayed at the top of search results.</li>\r\n 	<li>When members view their connections, connected members with the highest good deed points are displayed at the top.</li>\r\n</ul>', 'How does good deed points™ help members?', '', 'publish', 'closed', 'closed', '', 'how-does-good-deed-points-help-members', '', '', '2020-01-25 22:50:16', '2020-01-25 22:50:16', '', 0, 'https://goalore.com/?post_type=faqs&#038;p=565', 2, 'faqs', '', 0),
(571, 1, '2020-01-26 19:28:47', '2020-01-26 19:28:47', '<!-- wp:paragraph -->\n<p>Many are in situations at work or in personal life that seem routine with little improvement. &nbsp;The day to day responsibilities at work, home, family, and community are ever constant and take up a significant portion of our time to maintain stability in our lives. &nbsp;We endure the status quo to the best we can no matter how frustrated it gets at times. &nbsp;In many instances, the situation can be changed, even if it looks daunting at the beginning. Once you commit to change, it is time to chart a journey to bring about that change. In the beginning, you might know the next step or two, and not have a fully baked plan. This is quite normal – when you are trying to do something new, you are not going to be good at it immediately. &nbsp;It is important to start the journey with baby steps (small goals) that you can think of and over time, it can lead to big results. &nbsp;Here is a simple example of how to navigate a career change journey.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Goal 1 - Awareness</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Firstly, it is important to be self-aware.&nbsp; For example, you must know that your current job is not going to fulfill your aspirations in the long run. A simple way to gain this awareness is to write down the top 3 to 5 things you love to do in a job. Similarly, write down the top 3 to 5 things you do in the current job. Compare them to determine the gap with what you want to do and what you currently do.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Goal 2 - Assessment</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Having gained self-awareness, the next thing to do is to assess the type of change that you want to see. In the job example, not every job comes with the responsibilities we all like. If we spend the majority of time doing the things we like to do, most of us can endure those aspects of the jobs that we are not thrilled to do. &nbsp;Next, identify the ideal job profile that maximizes the type of responsibilities you like. It is also good to identify any training or education you require for the new job.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Goal 3 - Planning </strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Armed with this assessment, the next thing is to plan. You still have the current job to do and your day to day responsibilities. That is why it is important to plan – to find the time, getting your priorities right, and building a support system.&nbsp; The biggest investment you will need is with your time. This may mean you have to sacrifice a few things. It is also important to reach out to your friends and family to build your support system. If you need training, getting guidance from others who have done it before helps. You may also have to save to pay for the training.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Goal 4 – Execution</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>With your plan in place, now it is time for executing your plan. One important aspect of your plan is understanding important milestones along the way. This will help you understand the true progress you are making with the plan. There is a good chance that you will encounter unexpected challenges along the way. All the prior preparation gives you a good framework to tackle these challenges. Don’t panic if you must go back to the planning stage – this is all part of the journey. Remember your journey is unique to you and you cannot expect to know and plan for every eventuality. You will need to improvise and keep moving forward. Milestone by milestone, goal by goal, you will eventually end up in a better position than you started. It may not be the ideal situation you aspired, but better than the one you were in before. Most importantly, you made it happen. You changed the status quo and took control of your life. That is a huge morale booster and propel you further to newer goals. </p>\n<!-- /wp:paragraph -->', 'Baby steps lead to big outcomes', '', 'publish', 'open', 'open', '', 'baby-steps-lead-to-success', '', '', '2020-02-12 05:44:51', '2020-02-12 05:44:51', '', 0, 'https://goalore.com/?p=571', 0, 'post', '', 0),
(572, 1, '2020-01-26 20:41:47', '2020-01-26 20:41:47', '<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We lead busy lives with our jobs, kids, pets, family, and friends. The day to day activities in addition to cyclical must dos such as taxes, home/auto care, and health events take a lot of our time. Anytime we get to ourselves feels like a luxury. Even with everything going on, many feel that they could give back more to the community. Helping others provides an additional sense of purpose and satisfaction. It strengthens our bond with our community. We also make new friends and contacts. Others learn from you and they, in turn, could start helping others. &nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>There are so many ways one can help like examples below. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>Volunteering in the local school, library, or a community club/event</li><li>Fundraiser for a cause or help a friend</li><li>Help at animal shelters </li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>If any of the above fits your passions and you can help,\nthat is awesome! </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Now the big question: Yes, we may have the resources, experience, and knowledge that could help someone in our community, but how can we contribute if we are not able to be there at the right time and place?</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>This is one of the key reasons why we created Goalore. Goalore helps you to decouple your help from your busy everyday life. You decide what, who, when, and how to engage and help. This could be in the form of following someone’s goal and providing your point of view to help them overcome a challenge. Or you can form an alliance where you are working together with others to advance a common goal. Guiding someone in the right direction, helping them avoid mistakes, showing the possibilities, encourage their progress, cheering them along their journey, all these make a big impact on others. Your point of view may seem simple to you but could change someone’s life. &nbsp;We also hope that your act of kindness, your wisdom, and your achievements will inspire others to follow your example and they find ways to give back to the community.</p>\n<!-- /wp:paragraph -->', 'I want to help, but I can’t find the right time or avenue', '', 'publish', 'open', 'open', '', 'i-want-to-help-but-i-cant-find-the-right-time-or-avenue', '', '', '2020-02-12 05:41:47', '2020-02-12 05:41:47', '', 0, 'https://goalore.com/?p=572', 0, 'post', '', 0),
(573, 1, '2020-01-26 21:17:46', '2020-01-26 21:17:46', '<!-- wp:paragraph -->\n<p>A challenge is simply defined as an obstacle in front of you that needs to be overcome to make further progress. We face them at our jobs, school, doctor’s office, bank, friends, family, etc. Especially when you are working towards an ambitious goal, challenges are a major part of achieving the goal.  </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Challenges could be of many types. Challenges could be immediate (in the form of an issue) or something we anticipate occurring in the future (risk). They could be simple that you may be able to solve on your own. They can be needing additional training, knowledge, support from others. Challenges could be known ahead of time or they can spring up unexpectedly. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Whether we like them or not, challenges are an inevitable\npart of our life. They teach valuable life lessons such as the following.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>Being honest with ourselves</li><li>Reinforcing the value and strength of friends\nand family</li><li>Learn from our failures</li><li>Be resourceful</li><li>Anticipate challenges</li><li>Plan for contingencies</li><li>Be diligent to avoid making the same mistake\ntwice</li><li>Strengthen our resolve to overcome challenges</li><li>Instill confidence to make progress</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>Next time you encounter a challenge, take a step back, think about solutions, consult with your friends, plan, and do your best to address them. If you succeed, great! If not, don\'t despair. You have just learned a great lesson that will only make you stronger. </p>\n<!-- /wp:paragraph -->', 'Challenges – They are here and everywhere', '', 'publish', 'open', 'open', '', 'challenges-they-are-here-to-stay', '', '', '2020-02-12 05:24:58', '2020-02-12 05:24:58', '', 0, 'https://goalore.com/?p=573', 0, 'post', '', 0),
